import React from "react";

import { VStack } from "@chakra-ui/react";
import FeatureIcon from "../featureIcons";
import "./featureMenu.module.css";

const FeaturedMenu = () => {
  return (
    <VStack spacing={10} align="center">
      <FeatureIcon alt="thumbometer" src="/thumb.png" link="/thumb" />
      <FeatureIcon alt="raisehand" src="/raisehand.jpeg" link="/raisehand" />
      <FeatureIcon alt="livequiz" src="/quizzical.jpeg" link="/livequiz" />
    </VStack>
  );
};

export default FeaturedMenu;
